import React from "react";
import List from "../../src/moveOutList.json";
import './MoveOutList.css'

const MoveOutList = () => {
  return (
    <div>
      Move-out-listx
          <table className="styled-table">
            <thead className="table-header">
              <tr>
                <th>ID</th>
                <th>Caption</th>
                <th>Icon</th>
                <th>Date</th>
                <th>Address</th>
                <th>Room</th>
                <th>Location</th>
                <th>last Occupant</th>
                <th>UID</th>
                <th>Balance</th>
              </tr>
            </thead>
            <tbody>
              {List.map(() => (
                <tr className="table-row">
                    <td>
                      {MoveList.firstname}
                    </td>
                    <td>{MoveList.id}</td>
                    <td>{MoveList.caption}</td>
                    <td>{MoveList.icon}</td>
                    <td className="dropdown">

                    </td>
                    </tr>
                    ))}
                </tbody>
          </table>
      // })}
    </div>
  );
};

export default MoveOutList;
